import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="container">
        <nav>
          <div className="app-logo">EVENTLY</div>
          <div className="nav-list">
            <ul>
              <li>Map</li>
              <li>Events</li>
              <li><input type="text" placeholder="Search.."></input></li>

            </ul>
          </div>
        </nav></div>


      </header>
    </div>
  );
}


export default App;
